import React, { FC } from "react";
type footerItemTitle = { title: string };
const FooterItem: FC<footerItemTitle> = ({ title }) => {
  return (
    <li className="">
      <a href="#" className="text-sm">
        {title}
      </a>
    </li>
  );
};

export default FooterItem;
